    public int sumOfFlooredPairs(int[] nums) {
        int mod = 1000000007;
        long start = System.currentTimeMillis();
        System.out.println("start");
        Arrays.sort(nums);
        System.out.println("stage1 : cost " + (System.currentTimeMillis() - start) + "ms");
        int ans = 0;

        start = System.currentTimeMillis();
        for (int i = 0; i < nums.length; i++) {
            for (int j = i; j < nums.length; j++) {
                int x = nums[i] / nums[j];
                ans += x;
                if(x == 0)
                    break;
            }
            for (int j = i + 1; j < nums.length; j++) {
                int y = nums[j] / nums[i];
                ans = (ans + y)% mod;
            }
        }
        System.out.println("stage2 : cost " + (System.currentTimeMillis() - start) + "ms");
        return ans;
    }

    public int sumOfFlooredPairs2(int[] nums) {
        // 数组中每个 num 的数量统计
        int[] count = new int[100001];
        // 后缀和，大于等于 num 的数量统计
        int[] sum = new int[100002];
        int result = 0;
        for (int num : nums) {
            count[num]++;
        }
        for (int i = 100000; i > 0; i--) {
            sum[i] = count[i] + sum[i + 1];
        }
        for (int num : nums) {
            for (int i = num; i <= 100000; i += num) {
                result = (result + sum[i]) % 1000000007;
            }
        }
        return result;
    }
